INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 0.0, 0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 1, "2019/07/31 12:00:00", 24015, 4, 4, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 4.0, 0.0, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 2, "2019/07/31 12:00:00", 24016, 4, 1, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 0.0, 0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 3, "2019/07/31 12:00:00", 24017, 4, 4, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 5.2, 0.0, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 4, "2019/07/31 12:00:00", 24018, 1, 2, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 4.2, 0.0, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 5, "2019/07/31 12:00:00", 24019, 5, 6, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 0.0, 0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 6, "2019/07/31 12:00:00", 24020, 2, 2, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 6.4, 0.0, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 7, "2019/07/31 12:00:00", 24021, 1, 6, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 0.0, 0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 8, "2019/07/31 12:00:00", 24022, 2, 2, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 10.08, 0.0, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 9, "2019/07/31 12:00:00", 24023, 6, 3, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 5.0, 0.0, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 10, "2019/07/31 12:00:00", 24024, 1, 2, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10021, 0.0, 0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 11, "2019/07/31 12:00:00", 24025, 2, 2, "2030/12/17 14:59:59", 110501, "カオリ（サマー）");
